import React from 'react';

function Resume() {
  const resumeUrl = 'https://drive.google.com/file/d/15kfZ5v5DuzukfjjvzkgPRcf7vX99xSW6/view?usp=sharing';

  return (
    <div className="resume">
      <h1>My Resume</h1>
      <div className="resume-content">
        {/* <embed
          src={resumeUrl}
          type="application/pdf"
          width="100%"
          height="800px"
        /> */}

        <iframe 
          src={resumeUrl} 
          width="100%" 
          eight="500px" 
        />
      </div>
    </div>
  );
}

export default Resume;
